import React from 'react';
import { Media, Container, Col, Row } from 'react-bootstrap';
import bivakzones from './bivakzones.json';

export default function Media1() {
    return (
        <div>
            <Container>
                <Row>
                    <Col md={10}>
                        {
                            bivakzones.features
                                .map((bivakzone) => {
                                    if (bivakzone.geometry.type === 'Point') {
                                        return (bivakzone)

                                    } else {
                                        bivakzone.geometry.coordinates =
                                            bivakzone.geometry.coordinates[0][0]
                                        bivakzone.geometry.type = 'Point'
                                        return (bivakzone)
                                    }
                                })

                                .map((bivakzone) => (



                                    <ul className="list-unstyled" bivakzone={bivakzone} key={bivakzone.id}>
                                        <Media as="li">

                                            <img
                                                width={64}
                                                height={64}
                                                className="mr-3"
                                                src={`${bivakzone.properties.image}`}
                                                style={{ width: '100px', height: '100px' }}
                                                alt="Generic placeholder"
                                            />
                                            <Media.Body>
                                                <h5>   {bivakzone.properties.name}</h5>
                                                <p>
                                                    {bivakzone.properties.website}
                                                </p>
                                            </Media.Body>
                                        </Media>
                                        <hr />
                                        <br />



                                    </ul>

                                ))
                        }
                    </Col>
                </Row>

            </Container>
        </div>
    )
}
